    <script>
        function crearModal() {
            console.log('pase aka');

            //window.location.assign(""/TicketSpc/Create"")
            $(""#modalCreate"").load(""/TicketSpc/Create"", function () {
                cargarCombos();
                $('#modalCreate').modal(""show"");





